INSERT INTO `rdhvp_postmeta` VALUES("428","111","faq_0_question","Форма оплаты:");
INSERT INTO `rdhvp_postmeta` VALUES("429","111","_faq_0_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("430","111","faq_0_answer","По желанию клиента мы переводим оплату за картриджи на счет в любом банке (в том числе на карточный счет) или рассчитываемся наличными.");
INSERT INTO `rdhvp_postmeta` VALUES("431","111","_faq_0_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("432","111","faq_1_question","Как нужно открывать коробку?");
INSERT INTO `rdhvp_postmeta` VALUES("433","111","_faq_1_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("434","111","faq_1_answer","Коробка открывается сверху, на поверхности, где находится голограмма. Внизу это сделать сложнее, поскольку там имеются 3 полоски клея (а не одна, как наверху).

Чтобы открыть коробку, потребуется кухонный нож. Его нужно вставить в месте склеивания и оторвать крышку от клея, доведя нож до противоположного края.

Открывая коробку, важно не повредить крышку, на которой расположена голограмма и отрывная лента.");
INSERT INTO `rdhvp_postmeta` VALUES("435","111","_faq_1_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("436","111","faq_2_question","Какие картриджи вы не возьмете?");
INSERT INTO `rdhvp_postmeta` VALUES("437","111","_faq_2_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("438","111","faq_2_answer","Из новых картриджей мы не берем: совместимые, поддельные или не оригинальные, а также оригинальные струйные картриджи с истекшим сроком годности.

Из б/у картриджей мы не берем: совместимые, не оригинальные, восстановленные или перезаправленные, а также картриджи, имеющие механические повреждения (царапины на корпусе, сломанные или согнутые элементы), картриджи, из которых сыпется тонер.");
INSERT INTO `rdhvp_postmeta` VALUES("439","111","_faq_2_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("440","111","faq_3_question","Ищите ли Вы картриджи, отмеченные в вашем прайсе?");
INSERT INTO `rdhvp_postmeta` VALUES("441","111","_faq_3_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("442","111","faq_3_answer","Да, ищем! Для определения их стоимости позвоните по телефону 89160432372 или заполните форму обратной связи на нашем сайте. Сообщите производителя, модель и дату производства картриджа (если она имеется на упаковке). Также, Вы можете связаться с нами, перейдя в раздел контакты.");
INSERT INTO `rdhvp_postmeta` VALUES("443","111","_faq_3_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("444","111","faq_4_question","Что может повлиять на уменьшение цены в прайс-листе?");
INSERT INTO `rdhvp_postmeta` VALUES("445","111","_faq_4_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("446","111","faq_4_answer","В отношении новых оригинальных картриджей, на уменьшение цены может повлиять испорченный товарный вид коробки (скотч, вмятины, потертости, дырки и т.д.). Если дефекты не значительные, внимания на них не обращаем.

Уменьшению цены могут подлежать также картриджи, выпущенные ранее 2015 года и невостребованные на рынке модели.

В отношении б/у картриджей уменьшение цены возможно для стартовых картриджей, картриджей без защитных крышек, корпоративных картриджей.");
INSERT INTO `rdhvp_postmeta` VALUES("447","111","_faq_4_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("448","111","faq_5_question","Как происходит проверка картриджа специалистом?");
INSERT INTO `rdhvp_postmeta` VALUES("449","111","_faq_5_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("450","111","faq_5_answer","<p>При проверке новых картриджей: специалист компании осматривает внешний вид, дату производства, состояние упаковки, проводит проверку на оригинальность и проверяет, не открывалась ли коробка ранее. </p>
    <p>При проверке б/у картриджей: специалист компании осматривает картридж на предмет оригинальности, проверяет, не перезаправлялся ли он, нет ли на корпусе сломанных элементов, не сыпется ли из него тонер.
    </p>");
INSERT INTO `rdhvp_postmeta` VALUES("451","111","_faq_5_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("452","111","faq_6_question","Что такое \"набор\"?");
INSERT INTO `rdhvp_postmeta` VALUES("453","111","_faq_6_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("454","111","faq_6_answer","Набор – это полный комплект: оригинальный картридж, правильно открытая коробка без повреждений голограммы, отрывной ленты и оторванных элементов, картонные или иные вставки-держатели, защитная шторка на вал, чека и инструкция.");
INSERT INTO `rdhvp_postmeta` VALUES("455","111","_faq_6_answer","field_5a8bd85ea2484");
INSERT INTO `rdhvp_postmeta` VALUES("456","111","faq_7_question","Где на коробке найти дату производства?");
INSERT INTO `rdhvp_postmeta` VALUES("457","111","_faq_7_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("458","111","faq_7_answer","На картриджах HP и CANON дата указана в левом нижнем углу. Примеры на фотографиях ниже.
