INSERT INTO `rdhvp_postmeta` VALUES("465","111","_faq_9_question","field_5a8bd853a2483");
INSERT INTO `rdhvp_postmeta` VALUES("466","111","faq_9_answer","<p>В будние дни мы работаем с 10:00 до 19:00, но если Вы не успеваете приехать до закрытия или хотите приехать раньше открытия, позвоните по телефону 89160432372 и по возможности, мы пойдем Вам навстречу. В выходные и праздничные дни мы работаем в дежурном режиме, можем договориться о встрече с Вами в удобное время.</p>");
