INSERT INTO `rdhvp_posts` VALUES("102","2","2018-02-15 12:28:47","2018-02-15 09:28:47","<p class=\"otstup\">Компания «Тонерсервис» осуществляет покупку оригинальных картриджей для лазерных принтеров не только в Москве, но и в других регионах РФ. Мы покупаем, как новые картриджи, так и б/у, которые были использованы один раз и не перезаправлялись.</p>
<p class=\"otstup\"><span style=\"text-decoration: underline;\">Транспортировка</span> картриджей осуществляется любой удобной для Вас транспортной компанией. Чаще всего мы пользуемся услугами компании «Деловые Линии». Это обусловлено, тем, что представительства этой компании есть практически в каждом городе России, а также ценами и скоростью доставки. Вы упаковываете картриджи, привозите на терминал транспортной компании в вашем городе и отправляете в Москву по паспортным данным получателя - сотрудника нашей компании. Вам выдают накладную, по номеру которой на <a href=\"http://www.dellin.ru/\" target=\"_blank\" rel=\"noopener\">главной странице «Деловых Линий»</a> можно отследить весь путь груза от момента отправки до его получения.</p>
<p class=\"otstup\"><span style=\"text-decoration: underline;\">Упаковка</span> - это очень важный момент при отправке картриджей. Стоимость товара бывает высокой и будет крайне неприятно, если при погрузке товар будет поврежден. В любой транспортной компании есть услуга «Пaллетный Борт» - это деревянная обрешетка груза. Стоит она от 150 до 300 рублей, в зависимости от компании. Лучше всего отправлять именно так, поскольку это надежно обеспечивает сохранность груза. Помимо этого, сами картриджи лучше всего сложить в коробки либо большие плотные пакеты, для того, чтобы коробки картриджей не потеряли свой товарный вид.</p>
<p class=\"otstup\"><span style=\"text-decoration: underline;\">Оплата</span> за картриджи осуществляется путем перевода денежных средств на указанную Вами карту после того, как мы получаем картриджи, проверяем их состояние и оригинальность. При отправке от 10 и более новых картриджей, оплата доставки оплачивается частично. Иные варианты обсуждаются индивидуально, мы всегда готовы пойти навстречу нашим клиентам!</p>
<p class=\"otstup\">Вы можете быть уверены в том, что оплата за картриджи, состояние которых соответствует нашим требованиям и в оригинальности которых мы не сомневаемся, произойдет в день получения в полном объеме. В иных случаях осуществляется обязательный возврат груза отправителю.</p>
<p class=\"otstup\">Работать с нами надежно, так как главное для нас - это выстраивание долгосрочных, взаимовыгодных и доверительных отношений с нашими клиентами!</p>","Работа с регионами","","publish","open","closed","","rabota-s-regionami","","","2018-02-20 11:39:26","2018-02-20 08:39:26","","0","http://tonerservice.work/adipisci-ut-temporibus-vel-alias-earum/","0","page","","0");
INSERT INTO `rdhvp_posts` VALUES("103","3","2018-02-15 12:45:37","2018-02-15 09:45:37","<img class=\"logo\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/logo-toner1.png\" width=\"150\" />
<h1>условия бОНУСНой ПРОГРАММы</h1>
<p class=\"timelineparagraph\">Принять участие в бонусной программе может любой клиент, работающий с нашей компанией. Достигнув определенного объема продаж, Вы получите ценные подарки, а также дополнительные бонусы. Чем быстрее Вы достигните желаемого уровня бонусной программы, тем больше выгоды Вы сможете получить от работы с компанией «Тонерсервис».</p>
<ul class=\"w-clearfix timelineul\">
   <li class=\"w-clearfix timelineli firstitem\" style=\"opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px); transition: opacity 300ms, transform 700ms;\" data-ix=\"fade-inout-timeline-li\">
<div class=\"timeline-content-wrapper left\">
<p class=\"timelinecontenth3 left\"><span class=\"timelinenumber\">Продай на 200.000 рублей</span></p>
Уровень 1. Базовый
<img class=\"timelineimg\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/14553748705609c7cbe8857b0f1200389e_i11.jpg\" />
<h4 class=\"timelinecontenth4\">Мышь Microsoft Arc</h4>
<p class=\"timelinecontentparagraph\">Это надежная мышь, работающая без помех на расстоянии до 9 метров. В ней используется новейшая технология Bluetooth, потребляющая меньше энергии.</p>
</div></li>
   <li class=\"w-clearfix timelineli even\" style=\"opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px); transition: opacity 300ms, transform 700ms;\" data-ix=\"fade-inout-timeline-li\">
<div class=\"timeline-content-wrapper right\">
<p class=\"timelinecontenth3 right\"><span class=\"timelinenumber\">Продай на 500.000 рублей</span></p>
Уровень 2. Профессионал
<img class=\"timelineimg\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/14553752615609c7cbe8857b0f1200389f_61EzvaNREL._SL1134_11.jpg\" />
<h4 class=\"timelinecontenth4\">Акустика JBL Flip 3</h4>
<p class=\"timelinecontentparagraph\">Отмеченная наградами беспроводная акустическая система Flip 3 от JBL привносит в вашу жизнь насыщенное звучание, отлично сочетаясь практически с любыми мобильными телефонами и планшетами. При создании Flip 2 инженеры JBL руководствовались многолетним опытом создания акустики и передовыми тенденциями в промышленном дизайне.</p>
</div></li>
   <li class=\"w-clearfix timelineli\" style=\"opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px); transition: opacity 300ms, transform 700ms;\" data-ix=\"fade-inout-timeline-li\">
<div class=\"timeline-content-wrapper left\">
<p class=\"timelinecontenth3 left\"><span class=\"timelinenumber\">Продай на 1.300.000 рублей</span></p>
Уровень 3. Престиж
<img class=\"timelineimg\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/14553753325609c7cbe8857b0f120038a0_Aura_0352a9c741baa7411.jpg\" />
<h4 class=\"timelinecontenth4\">Акустика H. Kardon</h4>
<p class=\"timelinecontentparagraph\">Harman Kardon Aura, домашняя акустическая система, объединившая в себе ультрасовременный уровень производительности и превосходную роскошь звука Hi-Fi системы.</p>
</div></li>
   <li class=\"w-clearfix timelineli even\" style=\"opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px); transition: opacity 300ms, transform 700ms;\" data-ix=\"fade-inout-timeline-li\">
<div class=\"timeline-content-wrapper right\">
<p class=\"timelinecontenth3 right\"><span class=\"timelinenumber\">Продай на 2.500.000 рублей</span></p>
Уровень 4. Лидер
<img class=\"timelineimg\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/14553754885609c7cbe8857b0f120038a1_ipadairselectsilver2014101000x100011.jpg\" />
<h4 class=\"timelinecontenth4\">Apple iPad Air 2</h4>
<p class=\"timelinecontentparagraph\">Планшет Apple iPad Air 2 имеет дисплей Retina, уникальный датчик отпечатков пальцев Touch ID, мощный процессор A8X, улучшенные камеры iSight и FaceTime HD и еще более быструю беспроводную связь. И все это в прочном алюминиевом корпусе толщиной всего 6,1 мм. Планшет настолько портативен, что его можно брать с собой куда угодно. И делать с ним все, что захочется.</p>
</div></li>
   <li class=\"w-clearfix timelineli\" style=\"opacity: 1; transform: translateX(0px) translateY(0px) translateZ(0px); transition: opacity 300ms, transform 700ms;\" data-ix=\"fade-inout-timeline-li\">
<div class=\"timeline-content-wrapper left\">
<p class=\"timelinecontenth3 left\"><span class=\"timelinenumber\">Продай на 3.800.000 рублей</span>Уровень 5. Золотой</p>
<img class=\"timelineimg\" src=\"http://tonerservice.work/wp-content/uploads/2018/02/14553756205609c7cbe8857b0f120038a2_appleiphone6plussilver_141559309211.jpg\" />
<h4 class=\"timelinecontenth4\">Apple iPhone 7</h4>
<p class=\"timelinecontentparagraph\">iPhone 7 – это не просто телефон, а совершенно новый взгляд на мир. Главные новинки, это водонепроницаемый корпус, камера совершенно нового поколения и самый мощный процессор в линейке. На сегодняшний день iPhone 7 самое передовое устройство среди своих конкурентов.</p>
</div></li>
