INSERT INTO `rdhvp_posts` VALUES("114","3","2018-02-20 12:38:26","2018-02-20 09:38:26","Купили оригинальный лазерный картридж, а он не подошел к Вашему печатно-копировальному устройству? Обновили парк принтеров и копиров в офисе и ломаете голову, куда деть картриджи, оставшиеся на складе? Заменили отработавший свой ресурс картридж на новый и не знаете, что делать с прежним? Ни в коем случае не выбрасывайте, ведь на расходниках можно заработать!
<p class=\"title-column\">Вы можете продать оригинальные новые и б/у картриджи для принтера:</p>

<ul>
 	<li>компания «ТонерСервис» скупает оригинальные картриджи от лазерных и струйных принтеров у юридических лиц и граждан в Москве, Московской области и регионах,</li>
 	<li>в любом количестве,</li>
 	<li>мы специализируемся на скупке оригинальных картриджей любых марок: HP, Canon, Brother, Samsung, Epson, Panasonic, Kyocera, Xerox и проч.,</li>
 	<li>наши клиенты имеют возможность продать новые и б/у картриджи по более высоким ценам, чем у конкурентов,</li>
 	<li>мы всегда готовы выехать по месту расположения продавца (в офис или квартиру), чтобы сэкономить Ваше время. Вам нужно только позвонить нам по телефонам в разделе <a href=\"http://tonerservice.ru/#contacts\">Контакты</a>,</li>
 	<li>для постоянных клиентов – специальные условия сотрудничества: бонусная программа, подарки, премии в виде процента от стоимости сделки,</li>
 	<li>«ТонерСервис» выкупает новые и б/у картриджи на максимально выгодных для клиента условиях,</li>
 	<li>расчет на месте после заключения договора по факту осмотра и диагностики картриджей нашим специалистом.</li>
</ul>
Если Вы желаете продать новые и бу картриджи дорого – добро пожаловать в компанию «ТонерСервис». Мы не относимся к тем фирмам, которые скупают исключительно новые оригинальные картриджи в корпоративных коробках, то есть, в идеальном состоянии.
<p class=\"title-column\">Наши требования при скупке новых и использованных картриджей:</p>

<ol>
 	<li>Мы покупаем новые картриджи, как в упаковке, так и без неё, а также б/у картриджи, отработавшие свой ресурс в течение одного цикла (до заправки). Монохромные и многоцветные. С истекшим сроком годности.</li>
 	<li>У картриджей не должно быть влияющих на их работоспособность повреждений.</li>
 	<li>На корпусе не должно быть царапин.</li>
 	<li>Этикетка не должна быть повреждена.</li>
 	<li>Если Ваши картриджи не соответствуют этим требованиям, то советуем все равно связаться с нами, поскольку не исключено, что мы купим их по сниженной цене.</li>
 	<li>Стоимость картриджей зависит от их состояния, которое оценивается специалистом нашей компании.</li>
</ol>
<p class=\"title-column\">Скупка новых и б/у оригинальных картриджей в Москве и регионах – это их шанс на вторую жизнь</p>
Отправляя на помойку пустые (без тонера) старые картриджи или не востребованные новые, мало кто задумывается, что их можно использовать снова, причем не раз. Перед тем, как снова предложить теперь уже восстановленный картридж покупателям по более дешевой стоимости по сравнению с оригинальным, с ним работают специалисты.

Они полностью разбирают его для тщательной чистки всех узлов и деталей. Заменяют на новый магнитный, фотовал, вал переноса заряда и проявки. При необходимости обновляют износившиеся элементы, а также осуществляют замену предохранителя или чипа. Последний восстановительный этап – заправка картриджа тонером. Восстановленные картриджи в эпоху экономического кризиса стали пользоваться повышенным спросом во многих странах и в России в том числе. Это недорого и практично.

Но это – далеко не все. Представьте, что было бы с экологической средой, если бы технология рециклинга, как и прежде, обходила бы стороной производство расходных материалов для офисной техники.

Продавая картриджи в скупку, компании и граждане не только возвращают себе часть затрат, но и оберегают природу от варварского к ней отношения.

