INSERT INTO `rdhvp_posts` VALUES("122","3","2018-02-19 16:42:49","2018-02-19 13:42:49","<p class=\"otstup\">Компания Тонерсервис занимается покупкой новых и бывших в употреблении картриджей от струйных и лазерных принтеров известных мировых производителей оргтехники: HP, Xerox, Canon, Samsung, Brother, Kyocera, Lexmark и других.</p>
<p class=\"otstup\">У Вас скопились бу картриджи? Вы хотите их продать, сдать или утилизировать? Тонерсервис - отличное решение, мы скупаем не только сами картриджи, но и аккуратно вскрытые коробки от них. Также часто бывают случаи, когда Вы ошиблись и купили не ту модель картриджа к своему принтеру. Или ваша компания проводит замену модельного ряда офисной техники. Мы поможем Вам, произведем скупку расходных материалов. Вы можете сдать ненужные картриджи по хорошей цене. Покупка новых и бу картриджей осуществляется с выездом к клиенту. Это очень быстро и  удобно.</p>
Сейчас есть много компаний, осуществляющих скупку и приемку новых и бу картриджей. Но мы обладаем рядом преимуществ по сравнению с конкурентами.
<p class=\"otstup h2_about\">Наши преимущества:</p>

<ul>
 	<li>Квалифицированный, ответственный персонал, нацеленный на долгосрочное сотрудничество.</li>
 	<li>Работаем в вечернее время, выходные и праздничные дни.</li>
 	<li>Высокие цены на скупку новых и бу картриджей.</li>
 	<li>Скупаем картриджи не только в Москве, но и по всей России, а также в странах СНГ.</li>
 	<li>Осуществляем выезд наших специалистов по Москве и ближнему Подмосковью.</li>
 	<li>Предоставляем все необходимые закрывающие документы.</li>
 	<li>Оперативность в работе. Вы сразу получаете деньги после проверки картриджей</li>
 	<li>Удачное расположение офиса, удобный подъезд и парковка.</li>
</ul>","О компании","","inherit","closed","closed","","107-autosave-v1","","","2018-02-19 16:42:49","2018-02-19 13:42:49","","107","http://tonerservice.work/107-autosave-v1/","0","revision","","0");
